import './Auth.css'
import logo from '../assets/stack-overflow.ico'
function Auth(){
    return(
       <div className='Auth'>
       <img height='40px' src={logo} alt="logo"/>

       <form className='form'>
       <label className='label form-items'>Email</label><br/>
        <input type ="text"/><br/>
        <label className='label'>Password</label><br/>
        <input type ="password"/><br/>
        
       </form>
        </div>
    );
}

export default Auth;
